package com.github.tyshchenko.algs4fun.hackerrank;

import junitparams.JUnitParamsRunner;
import junitparams.Parameters;
import org.junit.Assert;
import org.junit.Test;
import org.junit.runner.RunWith;

import java.util.List;

import static java.util.Arrays.asList;
import static java.util.Collections.singletonList;
import static org.hamcrest.CoreMatchers.is;

/**
 * Created by denis on 8/1/17.
 */
@RunWith(JUnitParamsRunner.class)
public class MorganAndStringTest {

    public static Object[] data() {
        return new Object[][]{
                {
                        "1\n" +
                                "ZB\n" +
                                "ZQ\n",

                        "ZBZQ\n"
                },
                {

                        "2\n" +
                                "JACK\n" +
                                "DANIEL\n" +
                                "ABACABA\n" +
                                "ABACABA",

                        "DAJACKNIEL\n" +
                                "AABABACABACABA\n"
                },
                {
                        "1\n" +
                                "ABBC\n" +
                                "ABBA\n",
                        "AABBABBC\n"
                },
                {
                        "1\n" +
                                "CBAZ\n" +
                                "CBAA\n",
                        "CBAACBAZ\n"
                },
                {
                        "1\n" +
                                "CBA\n" +
                                "CBAA\n",
                        "CBAACBA\n"
                },

                {
                        "1\n" +
                                "\n" +
                                "\n",
                        "\n"
                }
        };
    }

    @Test
    @Parameters(method = "data")
    public void verifyLexiMinString(String input, String expected) {
        Assert.assertThat(MorganAndString.lexiMinString(input), is(expected));
    }


    public static Object[] combineData() {
        return new Object[][]{
                {"ABCD", asList("A", "B", "C", "D")},
                {"DCBA", singletonList("DCBA")},
                {"ABDCBAEF", asList("A", "B", "DCBA", "E", "F")},
                {"ABCBAABCDDEF", asList("A", "B", "CBAA", "B", "C", "DD", "E", "F")}
        };
    }

    @Test
    @Parameters(method = "combineData")
    public void verifyCombinationLogic(String input, List<String> result) {
        Assert.assertThat(MorganAndString.combineDescending(input), is(result));
    }
}